// --- command.acr_ed_proc.acr_ed.ToCmdline
algo::tempstr command::acr_ed_ToCmdline(command::acr_ed_proc& parent) {
    algo::tempstr retval;
    retval << parent.path << " ";
    command::acr_ed_PrintArgv(parent.cmd,retval);
    if (ch_N(parent.stdin)) {
        retval << " " << parent.stdin;
    }
    if (ch_N(parent.stdout)) {
        retval << " " << parent.stdout;
    }
    if (ch_N(parent.stderr)) {
        retval << " 2" << parent.stderr;
    }
    return retval;
}

