// --- command.amc..PrintArgv
// print command-line args of command::amc to string  -- cprint:command.amc.Argv
void command::amc_PrintArgv(command::amc & row, algo::cstring &str) {
    algo::tempstr temp;
    (void)temp;
    (void)row;
    (void)str;
    if (!(row.in_dir == "data")) {
        ch_RemoveAll(temp);
        cstring_Print(row.in_dir, temp);
        str << " -in_dir:";
        strptr_PrintBash(temp,str);
    }
    ch_RemoveAll(temp);
    command::query_Print(const_cast<command::amc&>(row), temp);
    str << " ";
    strptr_PrintBash(temp,str);
    if (!(row.out_dir == ".")) {
        ch_RemoveAll(temp);
        cstring_Print(row.out_dir, temp);
        str << " -out_dir:";
        strptr_PrintBash(temp,str);
    }
    if (!(row.proto == false)) {
        ch_RemoveAll(temp);
        bool_Print(row.proto, temp);
        str << " -proto:";
        strptr_PrintBash(temp,str);
    }
    if (!(row.report == true)) {
        ch_RemoveAll(temp);
        bool_Print(row.report, temp);
        str << " -report:";
        strptr_PrintBash(temp,str);
    }
    if (!(row.e == false)) {
        ch_RemoveAll(temp);
        bool_Print(row.e, temp);
        str << " -e:";
        strptr_PrintBash(temp,str);
    }
    if (!(row.trace.expr == "")) {
        ch_RemoveAll(temp);
        command::trace_Print(const_cast<command::amc&>(row), temp);
        str << " -trace:";
        strptr_PrintBash(temp,str);
    }
}

